import React from 'react';
import Header from '../../components/header/header';
import { ContainerBase } from '../../style';
import { ContainerList, ContainerPage, EachClient } from './style';

export default function FourPage() {
 return (
   <ContainerBase>
        <Header/>
        <ContainerPage>
          <ContainerList>
            <EachClient>
              <div>
                <span>name:</span>
                <span>email:</span>
                <span>telefone:</span>
                <span>endereco:</span>
                <span>cpf:</span>
              </div>
              <section>
                <button>edit</button>
                <button>X</button>
              </section>
            </EachClient>
          </ContainerList>
        </ContainerPage>
   </ContainerBase>
 );
}
